export const BackArrow: FC<{
	isMobile: boolean,
	handlePrevious: () => void
}> = ({ isMobile, handlePrevious }) => {
	const fontsize = isMobile ? 16 : 32;
	const fontWeight = 600;
	const lineHeight = "150%";
	const letterSpacing = isMobile ? "-0.32px" : "-0.64px";
	const fontColor = "#000";

	console.log(fontsize + "px");
	console.log(isMobile);

	const { t } = useTranslation(); // Assuming you're using react-i18next for translations

	return (
		<div onClick={handlePrevious} className="flex flex-row w-full cursor-pointer justify-start items-center">
			<ArrowLeftAiIcon />
			<WhiteSpace width="10px" />
			<CustomP
				color={fontColor}
				textAlign="center"
				fontSize={fontsize + "px"}
				fontWeight={fontWeight}
				lineHeight={lineHeight}
				letterSpacing={letterSpacing}
			>
				{t('vetai.backbutton')}
			</CustomP>
		</div>
	);
};
